export const numOfPlotsToRender = (sensoresSelected: number) => {
 
  // impar aumenta las columns
  let dynamicRows = 0;
  let dynamicColumns = 0;
  if (sensoresSelected === 1) {
    dynamicRows = 1;
    dynamicColumns = 1;
  }
  if (sensoresSelected === 2) {
    dynamicRows = 1;
    dynamicColumns = 2;
  }
  if (sensoresSelected > 2 && sensoresSelected < 5) {
    dynamicRows = 2;
    dynamicColumns = 2;
  }
  if (sensoresSelected > 4 && sensoresSelected < 7) {
    dynamicRows = 2;
    dynamicColumns = 3;
  }
  if (sensoresSelected >= 7) {
    dynamicRows = 2;
    dynamicColumns = 4;
  }
  if (sensoresSelected >= 9) {
    dynamicRows = 2;
    dynamicColumns = 5;
  }
  const objGrid = {
    rows: dynamicRows,
    columns: dynamicColumns,
    pattern: 'independent',
  };
  return objGrid;
};

